 door from the opener.";i:5;s:51:"Do this with the door in the fully closed position.";i:6;s:82:"With the door closed and disengaged from the opener manually lift the garage door.";i:7;s:83:"If the door is very heavy then you have a spring that is broken or that has failed.";i:8;s:99:"Perhaps the greatest cause of a garage door that will not open all the way up is a lack of balance.";i:9;s:70:"Test your doors balance by disconnecting it from the automatic opener.";i:10;s:47:"The door should raise and lower easily by hand.";i:11;s:48:"Pull your garage door so its about halfway open.";i:12;s:86:"If your garage door doesnt open all the way you may need to replace part or all of it.";i:13;s:125:"To repair a garage door thats not opening contact a professional garage door company that understands your door manufacturer.";i:14;s:71:"Some of the most common reasons why your garage door wont open include.";i:15;s:30:"Photo Eye Is Out of Alignment.";i:16;s:94:"One of our Craftsman garage door opener has recently started not always opening the whole way.";i:17;s:44:"It will come up to about five feet and stop.";i:18;s:82:"If we put it down and reverse it a few times eventually it will go all the way up.";i:19;s:100:"This doesnt happen with every open but its frequent enough to be frustrating - probably 20 of lifts.";i:20;s:54:"First make sure the door is not binding as it goes up.";i:21;s:93:"Pull the emergency release rope when the door is fully shut and then manually raise the door.";i:22;s:102:"If the door seems to be extremely heavy or the door binds I recommend calling a garage door repairman.";i:23;s:82:"Other Reasons Your Garage Door Wont Open All The Way The photo-eye is blocked out.";i:24;s:49:"The power source may be interrupted or disrupted.";i:25;s:37:"There may be loose or snapped cables.";i:26;s:44:"The level of sensitivity may need adjusting.";i:27;s:36:"The setting of the limit may be off.";i:28;s:43:"The garage door track has become dislodged.";i:29;s:45:"An 